const EVENTS = [
  {
    id: "e1",
    title: "New Year Celebration",
  },
  {
    id: "e2",
    title: "Christmas Roadshow",
  },
];

export default function EventsPage() {
  return (
    <>
      <h1>This is event page.</h1>
      <ul>
        {EVENTS.map((event) => {
          <li key={event.id}><Link to={event.id}>{event.title}</Link></li>;
        })}
      </ul>
    </>
  );
}
